import React from 'react';
import './App.css';
import { BrowserRouter as Router, Routes, Route } from 'react-router-dom';
import NavBar from './components/NavBar';
import BookingForm from "./components/BookingForm.js";
import HomePage from './components/Homepage';
import About from './components/About';
import Booking from './components/Booking';
import BikesAndScooters from './BikesAndScooters';

function App() {
  return (
    <Router>
      <div>
        {/* The NavBar component can be placed here if you want it to be present on all pages */}
        <NavBar />

        <Routes>
          <Route path="/" element={<HomePage />} />
          <Route path="/about" element={<About />} />
          <Route path="/booking" element={<BookingForm />} />
          <Route path="/bikes" element={<BikesAndScooters />} />
          <Route path="/scooters" element={<BikesAndScooters />} />
          <Route path="/vehicles" element={<HomePage />} />
          <Route path="/booking" element={<Booking />} />
        </Routes>
      </div>
    </Router>
  );
}

export default App;
